  true,\n\t\"url\": null,\n\t\"notes\": \"Gridded Population of the World, Version
  3 (GPWv3) National Boundaries are derived from the land area grid to show the outlines
  of pixels (cells) that contain administrative units in GPWv3 on a per-country/territory
  basis. The National Boundaries data are derived from the pixels as polygons and
  thus have rectilinear boundaries at large scale. Note that the polygons that outline
  the countries and territories are not official representations; rather, they represent
  the area covered by the statistical data as provided. The national/territorial boundaries
  are designed for cartographic use with the GPWv3 population raster datasets. GPWv3
  is produced by the Columbia University Center for International Earth Science Information
  Network (CIESIN) in collaboration with Centro Internacional de Agricultura Tropical
  (CIAT).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
